import React, { useState } from 'react';

function App() {
  const [employeeData, setEmployeeData] = useState(null);
  const [employeeList, setEmployeeList] = useState(null);
  const [id, setId] = useState('');

  const fetchEmployee = async () => {
    try {
      const response = await fetch('http://localhost:8080/api/employee/getEmployee', {
        method: 'POST', // Cambia el método a POST para enviar el ID en el cuerpo de la solicitud
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({ id: id }) // Envia el ID en el cuerpo de la solicitud como un objeto JSON
      });
      const data = await response.json();
      setEmployeeData(data.data);
      console.log('Employee Response:', data); // Agregamos el console.log para imprimir la respuesta del backend
      console.log('Employee Response:', employeeData);
    } catch (error) {
      console.error('Error fetching employee:', error);
      if (error instanceof TypeError && error.message === 'Failed to fetch') {
        console.error('Demasiadas peticiones. Intenta más tarde.'); // Agregamos un mensaje en caso de error
      }
    }
  };

  const fetchEmployeeList = async () => {
    try {
      const response = await fetch('http://localhost:8080/api/employee/getEmployeeList');
      const data = await response.json();
      setEmployeeList(data.data);
      console.log('Employee List Response:', data); // Agregamos el console.log para imprimir la respuesta del backend
    } catch (error) {
      console.error('Error fetching employee list:', error);
      if (error instanceof TypeError && error.message === 'Failed to fetch') {
        console.error('Demasiadas peticiones. Intenta más tarde.'); // Agregamos un mensaje en caso de error
      }
    }
  };

  return (
    <div className="container mt-5">
      <div className="row">
        <input
          type="text"
          placeholder="Ingrese la ID del empleado"
          value={id}
          onChange={(e) => setId(e.target.value)}
        />

      </div>
      <div>
        <br></br>
        <br></br>
        <button className="btn btn-primary" onClick={fetchEmployee}>Buscar Empleado</button>
        <button className="btn btn-secondary ms-2" onClick={fetchEmployeeList}>Lista de Empleados</button>
      </div>

      {employeeData && (
        <div>
          <h2>Detalles del empleado</h2>
          <table className="table table-bordered">
            <thead>
              <tr>
                <th>ID</th>
                <th>Name</th>
                <th>Salary</th>
                <th>Age</th>
                <th>Annual Salary</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>{employeeData.id}</td>
                <td>{employeeData.employee_name}</td>
                <td>{employeeData.employee_salary}</td>
                <td>{employeeData.employee_age}</td>
                <td>{employeeData.employee_annual_salary}</td>
              </tr>
            </tbody>
          </table>
        </div>
      )}

      {employeeList && (
        <div>
          <h2>Lista de empleados</h2>
          <table className="table table-bordered">
            <thead>
              <tr>
                <th>ID</th>
                <th>Name</th>
                <th>Salary</th>
                <th>    Age    </th>
                <th>Annual Salary</th>
              </tr>
            </thead>
            <tbody>
              {employeeList.map((employee) => (
                <tr key={employee.id}>
                  <td>{employee.id}</td>
                  <td>{employee.employee_name}</td>
                  <td>{employee.employee_salary}</td>
                  <td>{employee.employee_age}</td>
                  <td>{employee.employee_annual_salary}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}

export default App;
